import React from "react";
import styled from "styled-components";
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
const StyledDiv = styled.div`
  width: 90%;
  height: 80px;
  left: 0;
  right: 0;
  margin: auto;
  margin-top: 20px;
  border: 1px solid black;
`;
const StyledList = styled.ul`
  display: flex;
  width: 100%;
  height: 250px;
  justify-content: center;
  gap: 20px;
  align-items: center;
  list-style-type: none;
`;
const StyledListItems = styled.div`
  width: 165px;
  height: 80px;
  cursor: pointer;
  img {
    width: 100%;
    height: auto;
  }
`;
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
////////////////////////////////////////////////////////////////
function SetProducts({ deactProd, shopList }) {
  return (
    <StyledDiv>
      <StyledList>
        <StyledListItems>
          <img src={amazonLogo} alt="Amazon" onClick={() => deactProd(1)} />
        </StyledListItems>
        <StyledListItems>
          <img src={christLogo} alt="Christ" onClick={() => deactProd(2)} />
        </StyledListItems>
      </StyledList>
    </StyledDiv>
  );
}

export default SetProducts;
